ドクロ型のおしゃれなアウトドアマルチツール<br>
キーホルダーとしても使用できます<br>

マイナスドライバーや栓抜きなど便利にご活用ください<br>

さびにくいステンレス製で屋外使用もなんのその
薄型で邪魔にならないので持ち運びも楽々<br>

さりげなくおしゃれなツールとして携帯してください<br><br>

サイズ：8x4x0.5 cm<br>
重量：30g<br>
生産国：中国<br><br>

