キータイプのナイフです<br>
折りたたむと6cmなので超コンパクト<br>
鍵型なのでキーホルダーに付けていても違和感なし<br>
<br>
キャンプや登山の必須アイテム<br>
便利に使いこなしてください<br>
<br>
バーベキューなどでも大活躍まちがいなし<br>
<br>
サイズ：折りたたみ時：6×2.3cm<br>
　　　　ナイフ開き時：10.5×2.3cm<br>
　　　　厚さ：0.5cm<br>
重量：20g<br>
