持ち運びに便利でアウトドアに最適<br>
災害時やアウトドアに！多機能マルチツール！<br>
<br>
アウトドア好き必見！<br>
コンパクトで常に持ち運べて便利なマルチツール<br>
程よい大きさで使いやすい！LEDライト内蔵で暗い場所でも使用できます。<br>
<br>
手のひらサイズでベルトに装着可能！<br>
マルチツールをベルトに装着することができるので、<br>
アウトドア以外にも常に持ち運んで非常時に使用することができます。<br>
<br>
脱着の際は本体だけを外すことができるので、使用する際にもたつくことはありません。<br>
<br>
多機能マルチツール！<br>
ナイフやハサミ・栓抜きなどアウトドアなどの際にあると便利な機能を搭載！<br>
ダンボールのテープを切りたい時やちょっとした物を切りたい時などに大変便利です。<br>
<br>
商品スペック<br>
サイズ(約)：長さ72mm×幅41mm×厚さ16mm<br>
重量(約)：41g<br>
ブレード素材：高炭素鋼<br>
本体素材：プラスチック<br>
電池：CR927 3Vリチウム電池 × 2 (テスト電池付属)<br>
<br>
※電池を交換する際は3ヶ所のネジを外して交換して下さい。<br>
