登山やキャンプなど、万が一に備えるアウトドアツールセット!!<br>
<br>
動きを抑えるソフトスポンジを内蔵し、<br>
ツール類をしっかり保管できる専用ケースに、6個のツールを詰め込みました!!<br>
<br>
・マルチペンチ<br>
　折り畳み状態から開けばペンチになる多機能ツール<br>
　更に持ち手部分にLEDライト、ノコギリ、栓抜き、ドライバー、ミニナイフを搭載<br>
<br>
・カード型ツール<br>
　極薄2mmのカード型の本体に11の機能を盛り込んだ超多機能ツール<br>
　缶切り、ナイフ、ネジ回し、栓抜き、目盛りスケール、六角スパナ、<br>
　六角スパナ小、ターンバックル、ノコギリ、方位測定目盛り、キーリング<br>
<br>
・ファイアスターター<br>
　マグネシウムを付属の鉄板で削り、火種を飛ばして着火<br>
　ライターやマッチと違い、水に強く酸素と結合しやすいため、<br>
　低酸素な場所や雨風にさらされる場所など、過酷な環境下でも着火ができます<br>
<br>
・ワイヤーソー<br>
　薪の調達など、木材の切断に<br>
<br>
・コンパス<br>
<br>
・ホイッスル<br>
<br>
セット内容<br>
硬質ケース、マルチペンチ、カード型ツール、<br>
ワイヤーソー、ファイアスターター、コンパス、ホイッスル<br>
<br>
ケースサイズ：約 13×8×4cm<br>
総重量：約 210g<br>
カラー：ランダム<br>
生産国：中国<br>
<br>
